//typedef long long __int64;
 
class HiddenSquares
{
public:
  int n;
  int A[110][110],B[110][110];
  int IDX[110],IDY[110];
  void initp(vector<int> &x1,vector<int> &x2,int ID[])
  {
    for (int k=0;k<110;k++)
      ID[k]=-1;
    set<int> M;
    M.clear();
    int i;
    for (i=0;i<x1.size();i++)
      M.insert(x1[i]);
    for (i=0;i<x2.size();i++)
      M.insert(x2[i]);
    map<int,int> MS;
    MS.clear();
    int c=1;
    for (set<int>::iterator it=M.begin();it!=M.end();++it,c++)
    {
      ID[c]=*it;
      MS[*it]=c;
    }
    for (i=0;i<x1.size();i++)
      x1[i]=MS[x1[i]];
    for (i=0;i<x2.size();i++)
      x2[i]=MS[x2[i]];
  }
  int count(vector <int> x1, vector <int> y1, vector <int> x2, vector <int> y2)
  {
    int i,j;
    n=x1.size()*2;
    initp(x1,x2,IDX);
    initp(y1,y2,IDY);
    memset(A,0,sizeof(A));
    memset(B,0,sizeof(B));
    for (i=0;i<x1.size();i++)
    {
      int sX=x1[i],sY=y1[i];
      int tX=x2[i],tY=y2[i];
      int k;
      for (k=sY;k<tY;k++)
        A[sX][k]=A[tX][k]=1;
      for (k=sX;k<tX;k++)
        B[k][sY]=B[k][tY]=1;
    }
    for (i=n;i>0;i--)
      for (j=n;j>0;j--)
      {
        A[i][j]=(A[i][j]==0)?0:(1+A[i][j+1]);
        B[i][j]=(B[i][j]==0)?0:(1+B[i+1][j]);
      }
    int result=0;
    for (i=1;i<=n;i++)
      for (j=1;j<=n;j++)
        for (int u=i+1;u<=n;u++)
          for (int v=j+1;v<=n;v++) if (IDX[u]!=-1 && IDY[v]!=-1)
            if (IDX[u]-IDX[i]==IDY[v]-IDY[j])
            {
              if (A[i][j]>=v-j && A[u][j]>=v-j && B[i][j]>=u-i && B[i][v]>=u-i)
                result++;
            }
    return result;
  }
};

